VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 3, 'work differently. They are battery-operated smoking devices. Using an e-cigarette is called vaping. Researchers still have a lot to learn about the health effects of using e-cigarettes. We do know that they contain nicotine, which is highly addictive and a health danger to you and your fetus if you are pregnant, children, and teens. And e-cigarettes also expose non-smokers to secondhand aerosols (rather than secondhand smoke), which contain harmful chemicals. Smokeless tobacco, such as chewing tobacco and snuff, is also bad for your health. Smokeless tobacco can cause certain cancers, including oral cancer. It also increases your risk of getting heart disease, gum disease, and oral lesions. Why should I quit? Remember, there is no safe level of tobacco use. Smoking even just one cigarette per day over a lifetime can cause smoking-related cancers and premature death. Quitting smoking can reduce your risk of health problems and add years to your life.', '{0.6149255037307739,-0.20074965059757233,-0.5071478486061096,0.2869854271411896,0.7966949343681335,0.8082507252693176,-0.5993911623954773,-0.04678046330809593,-0.14608637988567352,-0.4558670222759247,0.3165232539176941,0.8683683276176453,0.13010065257549286,-0.8484877347946167,-0.7529872059822083,-0.15503965318202972,0.652332067489624,-0.03720956668257713,0.21359777450561523,-0.3926389217376709,-0.1785820871591568,-0.06339357793331146,-0.5187567472457886,-0.24977241456508636,-0.2304634004831314,0.3654063940048218,-0.08969531953334808,-0.12096764147281647,0.0013336592819541693,-0.4344055950641632,-0.7360970973968506,0.3916000425815582,-0.19303131103515625,0.5256878137588501,-0.17959100008010864,0.47992855310440063,-0.17751577496528625,0.9162147045135498,0.040080342441797256,-0.39634835720062256,-0.39948686957359314,0.4150281250476837,-0.20719407498836517,0.21280750632286072,-0.7594817876815796,0.1210540309548378,0.880596399307251,-0.027367535978555