VALUES ('MedlinePlus:  A L C O H O L I S M ', 'Alcohol Use Disorder (AUD) Also called: Alcohol Abuse, Alcohol dependence, Alcoholism On this page Basics Summary Start Here Symptoms Diagnosis and Tests Prevention and Risk Factors Treatments and Therapies Learn More Living With Related Issues Genetics See, Play and Learn Health Check Tools Research Statistics and Research Clinical Trials Journal Articles Resources Find an Expert For You Teenagers Older Adults Patient Handouts Summary What is alcohol use disorder (AUD)? For most adults, moderate alcohol use is probably not harmful. Your risk of developing an alcohol use disorder (AUD) depends on how much, how often, and how quickly you drink alcohol. Alcohol misuse means that drinking causes distress and harm. Over time alcohol misuse can increase your risk of AUD. AUD can range from mild to severe, depending on the symptoms. Severe AUD is sometimes called alcoholism or alcohol dependence. AUD is a disease that causes: Craving - a strong need to drink Loss of control - not being able to stop drinking once you''ve started Negative emotional state - feeling anxious and irritable when you are not drinking What is binge drinking? Binge drinking is a type of alcohol misuse. It means drinking so much at once that your blood alcohol concentration (BAC) level is 0.08% or more. For a man, this usually happens after having 5 or more drinks within a few hours. For a woman, it is after about 4 or more drinks within a few hours. Not everyone who binge drinks has an AUD, but they are at higher risk for getting one. What are the dangers of too much alcohol? Too much alcohol is dangerous. Heavy drinking can increase the risk of certain cancers. It may lead to liver diseases, such as fatty liver disease and cirrhosis. It can also cause damage to the brain and other organs. Drinking during pregnancy can harm your fetus. Alcohol also increases the risk of death from car crashes, injuries, homicide, and suicide. How do I know if I have an alcohol use disorder (AUD)? You may have an AUD if you can answer yes to two or more of these questions: In the past year, have you: Ended up drinking more or for a longer time than you had planned to? Wanted to cut down or stop drinking, or tried to, but couldn''t? Spent a lot of your time drinking or recovering from drinking? Felt a strong need to drink? Found that drinking - or being sick from drinking - often interfered with your family life, job, or school? Kept drinking even though it was causing trouble with your family or friends? Given up or cut back on activities that you enjoyed just so you could drink? Gotten into dangerous situations while drinking or after drinking? Some examples are driving drunk and having unsafe sex. Kept drinking even though it was making you feel depressed or anxious? Or when it was adding to another health problem? Had to drink more and more to feel the effects of the alcohol? Had withdrawal symptoms when the alcohol was wearing off? They include trouble sleeping, shakiness, irritability, anxiety, depression, restlessness, nausea, and sweating. In severe cases, you could have a fever, seizures, or hallucinations. If you have any of these symptoms, your drinking may already be a cause for concern. The more symptoms you have, the more serious the problem is. What should I do if I think that I might have an alcohol use disorder (AUD)? If you think you might have an AUD, see your health care provider for an evaluation. Your provider can help make a treatment plan, prescribe medicines, and if needed, give you treatment referrals. NIH: National Institute on Alcohol Abuse and Alcoholism Start Here How Many Is Too Many? When Drinking Becomes a Problem (National Institutes of Health) Also in Spanish Rethinking Drinking: Questions and Answers (National Institute on Alcohol Abuse and Alcoholism) Understanding Alcohol Use Disorder (National Institute on Alcohol Abuse and Alcoholism) Also in Spanish Symptoms What Are Symptoms of Alcohol Use 