VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 2, ', such as fatty liver disease and cirrhosis. It can also cause damage to the brain and other organs. Drinking during pregnancy can harm your fetus. Alcohol also increases the risk of death from car crashes, injuries, homicide, and suicide. How do I know if I have an alcohol use disorder (AUD)? You may have an AUD if you can answer yes to two or more of these questions: In the past year, have you: Ended up drinking more or for a longer time than you had planned to? Wanted to cut down or stop drinking, or tried to, but couldn''t? Spent a lot of your time drinking or recovering from drinking? Felt a strong need to drink? Found that drinking - or being sick from drinking - often interfered with your family life, job, or school? Kept drinking even though it was causing trouble with your family or friends? Given up or cut back on activities that you enjoyed just so you could drink? Gotten into dangerous situations while drinking or after drinking?', '{-0.09842997789382935,-0.17408236861228943,-1.0130032300949097,0.32389453053474426,0.08935905992984772,0.36291491985321045,-0.7014710903167725,0.42120373249053955,0.3963283598423004,-0.1459052711725235,0.4666381776332855,0.19829021394252777,-0.011659322306513786,-0.008276894688606262,-0.4692499041557312,0.372098445892334,-0.24295207858085632,0.7032277584075928,0.08127490431070328,-0.677699625492096,-0.027200695127248764,-0.4657191336154938,-0.19614046812057495,0.0761115625500679,-0.44951286911964417,-0.2416953444480896,-0.5025668740272522,-0.28534847497940063,-0.038912396878004074,-0.0038116376381367445,-0.5639446973800659,0.4970119595527649,-0.4958009719848633,-0.2261487990617752,0.16692593693733215,-0.286691278219223,-0.2120772749185562,0.31810399889945984,0.1832132488489151,-0.4163186252117157,-0.4366653561592102,-0.47566062211990356,0.20198489725589752,0.05078050121665001,-0.18117168545722961,0.6042380928993225,0.2222091257572174,-0.2709594964981079,1