VALUES ('MedlinePlus:  I M M U N I Z A T I O N ', 'Vaccines Also called: Immunization, Vaccination On this page Basics Summary Start Here Diagnosis and Tests Learn More Related Issues Specifics See, Play and Learn Images Videos and Tutorials Research Statistics and Research Clinical Trials Journal Articles Resources Reference Desk Find an Expert For You Children Women Older Adults Patient Handouts Summary What are vaccines? Vaccines are injections (shots), liquids, pills, or nasal sprays that you take to teach your body''s immune system to recognize and defend against harmful germs. For example, there are vaccines to protect against diseases caused by: Viruses, like the ones that cause the flu and COVID-19 Bacteria, including tetanus, diphtheria, and pertussis What are the types of vaccines? There are several types of vaccines: Live-attenuated vaccines use a weakened form of the germ. Inactivated vaccines use a killed version of the germ. Subunit, recombinant, polysaccharide, and conjugate vaccines use only specific pieces of the germ, such as its protein, sugar, or casing. Toxoid vaccines use a toxin (harmful product) made by the germ. mRNA vaccines use messenger RNA, which gives your cells instructions for how to make a protein (or piece of a protein) of the germ. Viral vector vaccines use genetic material, which gives your cells instructions for making a protein of the germ. These vaccines also contain a different, harmless virus that helps get the genetic material into your cells. These vaccines may work in different ways, but they all spark an immune response. The immune response is the way your body defends itself against substances it sees as foreign or harmful. These substances include germs that can cause disease. What happens in an immune response? There are different steps in the immune response: When a germ invades, your body sees it as foreign. Your immune system helps your body fight off the germ. Your immune system also remembers the germ. It will attack the germ if it ever invades again. This "memory" protects you against the disease that the germ causes. This type of protection is called immunity. What are immunization and vaccination? Immunization is the process of becoming protected against a disease. But it can also mean the same thing as vaccination, which is getting a vaccine to become protected against a disease. Why are vaccines important? Vaccines are important because they protect you against many diseases. These diseases can be very serious. So getting immunity from a vaccine is safer than getting immunity by being sick with the disease. For a few vaccines, getting vaccinated can actually give you a better immune response than getting the disease would. But vaccines don''t just protect you. They also protect the people around you through community immunity. What is community immunity? Community immunity, or herd immunity, is the idea that vaccines can help keep communities healthy. Normally, germs can travel quickly through a community and make a lot of people sick. If enough people get sick, it can lead to an outbreak. But when enough people are vaccinated against a certain disease, it''s harder for that disease to spread to others. This type of protection means that the entire community is less likely to get the disease. Community immunity is especially important for people who can''t get certain vaccines. For example, they may not be able to get a vaccine because they have weakened immune systems. Others may be allergic to certain vaccine ingredients. And newborn babies are too young to get some vaccines. Community immunity can help to protect them all. Are vaccines safe? Vaccines are safe. They must go through extensive safety testing and evaluation before they are approved in the United States. What is a vaccine schedule? A vaccine, or immunization, schedule lists which vaccines are recommended for different groups of people. It includes who should get the vaccines, how many doses they need, and when they should get them. In the United States, the Centers for Disease Control and Prevention (CDC) publishes the vaccine schedule. It''s important for both children and adults to get their vaccines according to the schedule. Following the schedule allows them to get protection from the diseases at exactly the right time. Start Here Adult Immunization Schedule by Age (Addendum Updated June 27, 2024) (Centers for Disease Control and Prevention) Explaining How Vaccines Work (Centers for Disease Control and Prevention) Get Vaccines to Protect Your Health (Adults Ages 19 to 49 Years) (Office of Disease Prevention and Health Promotion) Also in Spanish Vaccine Basics (Department of Health and Human Services) Also in Spanish Diagnosis and Tests Screening Checklist for Contraindications to Vaccines for Adults (Immunization Action Coalition) - PDF Also in Spanish Related Issues Staying Up to Date with Your Vaccine Records (Centers for Disease Control and Prevention) Also in Spanish Vaccinations and Flu Shots for People with Cancer (American Cancer Society) Also in Spanish Vaccinations for Adults with Diabetes (Immunization Action Coalition) - PDF Vaccine Safety: MedlinePlus Health Topic (National Library of Medicine) Also in Spanish Vaccines Protect Your Community (Department of Health and Human Services) Also in Spanish Specifics A New Vaccine is Here to Protect You and Your Loved Ones from RSV This Winter Also in Spanish Current Vaccine Shortages and Delays (Centers for Disease Control and Prevention) Travelers'' Health: Destinations (Centers for Disease Control and Prevention) Vaccination Is the Best Protection against Measles (Food and Drug Administration) Also in Spanish Vaccine Basics (Centers for Disease Control and Prevention) Vaccine Information for Adults (Centers for Disease Control and Prevention) Also in Spanish Who Should Not Get Vaccinated with These Vaccines? (Centers for Disease Control and Prevention) Images (Vaccine-Preventable Disease) Photo Library (Immunization Action Coalition) Videos and Tutorials Vaccines (Medical Encyclopedia) Also in Spanish Statistics and Research VaxView Vaccination Coverage (Centers for Disease Control and Prevention) Clinical Trials ClinicalTrials.gov: Vaccines (National Institutes of Health) Journal Articles References and abstracts from MEDLINE/PubMed (National Library of Medicine) Article: Effects of scalable, wordless, short, animated storytelling videos on hope in... Article: Factors affecting caregivers'' HPV vaccination decisions for adolescent girls: A secondary... Article: Impact of multifaceted health education on influenza vaccination health literacy in... Vaccines -- see more articles Reference Desk Overview of the Immune System (National Institute of Allergy and Infectious Diseases) Find an Expert Centers for Disease Control and Prevention Also in Spanish National Institute of Allergy and Infectious Diseases National Vaccine Program (Department of Health and Human Services, Office of Infectious Disease and HIV/AIDS Policy) Children Childhood Immunization: MedlinePlus Health Topic (National Library of Medicine) Also in Spanish Women Pregnancy and Vaccination (Centers for Disease Control and Prevention) Vaccine Recommendations Before, During, and After Pregnancy (Centers for Disease Control and Prevention) Vaccines and Pregnancy (Organization of Teratology Information Specialists) Also in Spanish Older Adults Vaccinations and Older Adults (National Institute on Aging) Also in Spanish Patient Handouts Immunizations for people with diabetes (Medical Encyclopedia) Also in Spanish', 'NIH_MedlinePlus', 'immunization', 'https://medlineplus.gov/immunization.html', 'patient_education', '{"content_hash": "563e7b8107d0e10e", "embedding_date": "2025-06-25T14:49:18.030997", "scraper_source": "NIH_MedlinePlus", "category": "patient_education", "subcategory": "medlineplus", "document_type": "patient_education", "published_date": "", "original_url": "https://medlineplus.gov/immunization.ht