VALUES ('MedlinePlus:  G E R M S A N D H Y G I E N E ', 'Germs and Hygiene On this page Basics Summary Start Here Prevention and Risk Factors Learn More Specifics See, Play and Learn No links available Research Clinical Trials Journal Articles Resources Find an Expert For You Children Teenagers Women Summary What are germs? Germs are microorganisms. This means that they can be seen only through a microscope. They can be found everywhere - in the air, soil, and water. There are also germs on your skin and in your body. Many germs live in and on our bodies without causing harm. Some even help us to stay healthy. But some germs can make you sick. Infectious diseases are diseases that are caused by germs. The main types of germs are bacteria, viruses, fungi, and parasites. How do germs spread? There are different ways that germs can spread, including: Through touching a person who has the germs or making other close contact with them, such as kissing, hugging, or sharing cups or eating utensils Through breathing air after a person with the germs coughs or sneezes Through touching the feces (poop) of someone who has the germs, such as changing diapers, then touching your eyes, nose, or mouth Through touching objects and surfaces that have germs on them, then touching your eyes, nose, or mouth From mother to baby during pregnancy and/or childbirth From insect or animal bites From contaminated food, water, soil, or plants How can I protect myself and others from germs? You can help protect yourself and others from germs: When you have to cough or sneeze, cover your mouth and nose with a tissue or use the inside of your elbow Wash your hands well and often. You should scrub them for at least 20 seconds. It is important to do this when you are most likely to get and spread germs: Before, during, and after preparing food Before eating food Before and after caring for someone at home who is sick with vomiting or diarrhea Before and after treating a cut or wound After using the toilet After changing diapers or cleaning up a child who has used the toilet After blowing your nose, coughing, or sneezing After touching an animal, animal feed, or animal waste After handling pet food or pet treats After touching garbage If soap and water are not available, you can use an alcohol-based hand sanitizer that contains at least 60% alcohol Stay home if you are sick Avoid close contact with people who are sick Practice food safety when handling, cooking, and storing food Regularly clean and disinfect frequently touched surfaces and objects Start Here About Handwashing (Centers for Disease Control and Prevention) About Hygiene (Centers for Disease Control and Prevention) Germs: Understand and Protect against Bacteria, Viruses, and Infections (Mayo Foundation for Medical Education and Research) Also in Spanish Hand Hygiene Frequently Asked Questions (Centers for Disease Control and Prevention) Your Body''s Bugs: Nurturing Healthy Microbes (National Institutes of Health) Also in Spanish Prevention and Risk Factors Eight Ways to Guard Against Germs in Everyday Life (Cystic Fibrosis Foundation) - PDF Hand Washing: Do''s and Dont''s (Mayo Foundation for Medical Education and Research) Also in Spanish Specifics Hand Sanitizer Facts (Centers for Disease Control and Prevention) Healthy Habits: Coughing and Sneezing (Centers for Disease Control and Prevention) How to Make Water Safe in an Emergency (Centers for Disease Control and Prevention) If Soap and Water Are Not Available, Hand Sanitizers May Be a Good Alternative (Food and Drug Administration) Also in Spanish Preventing Swimming-related Illnesses (Centers for Disease Control and Prevention) Also in Spanish Q&A for Consumers: Hand Sanitizers and COVID-19 (Food and Drug Administration) Also in Spanish Safely Using Hand Sanitizer (Food and Drug Administration) Also in Spanish Skip the Antibacterial Soap;

