VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 1, 'by germs. The main types of germs are bacteria, viruses, fungi, and parasites. How do germs spread? There are different ways that germs can spread, including: Through touching a person who has the germs or making other close contact with them, such as kissing, hugging, or sharing cups or eating utensils Through breathing air after a person with the germs coughs or sneezes Through touching the feces (poop) of someone who has the germs, such as changing diapers, then touching your eyes, nose, or mouth Through touching objects and surfaces that have germs on them, then touching your eyes, nose, or mouth From mother to baby during pregnancy and/or childbirth From insect or animal bites From contaminated food, water, soil, or plants How can I protect myself and others from germs? You can help protect yourself and others from germs: When you have to cough or sneeze, cover your mouth and nose with a tissue or use the inside of your elbow Wash your hands well and often.', '{-0.04596056789159775,0.5119622349739075,0.3324429392814636,-0.5106205940246582,0.3557482659816742,0.27513566613197327,0.5423056483268738,-0.23367273807525635,-0.22826474905014038,0.12103404849767685,0.35324251651763916,1.0252273082733154,0.21405363082885742,0.4199911057949066,-0.8617592453956604,0.13229218125343323,-0.6652436852455139,-0.04147546365857124,-0.04645594209432602,-0.9919480085372925,-0.43557482957839966,0.21399913728237152,-0.2587621212005615,0.036582913249731064,-0.09603635221719742,0.49924376606941223,0.18585458397865295,-0.830752432346344,0.09403526782989502,0.60198974609375,-0.41378873586654663,0.5276337265968323,0.583800196647644,1.018697738647461,0.4083515405654907,0.33828410506248474,-0.4368670582771301,0.9441149234771729,1.2501457929611206,-0.6659746170043945,0.40269312262535095,-0.8710008859634399,-0.014898963272571564,0.20224978029727936,-0.803878664970398,-0.5590723156929016,0.3480638563632965,-0.2068748921155