VALUES ('MedlinePlus:  S T R O K E ', 'Stroke Also called: Brain attack, CVA On this page Basics Summary Start Here Symptoms Diagnosis and Tests Prevention and Risk Factors Treatments and Therapies Learn More Related Issues Specifics Genetics See, Play and Learn Images Research Statistics and Research Clinical Trials Journal Articles Resources Reference Desk Find an Expert For You Women Older Adults Patient Handouts Summary What is a stroke? A stroke happens when there is a loss of blood flow to part of the brain. Your brain cells cannot get the oxygen and nutrients they need from blood, and they start to die within a few minutes. This can cause lasting brain damage, long-term disability, or even death. If you think that you or someone else is having a stroke, call 911 right away. Immediate treatment may save someone''s life and increase the chances for successful rehabilitation and recovery. What are the types of stroke? There are two types of stroke: Ischemic stroke is caused by a blood clot that blocks or plugs a blood vessel in the brain. This is the most common type;

