VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 5, 'hours of when your symptoms started. The sooner you can get it, the better your chance of recovery. If you cannot get that medicine, you may get medicine that helps stop platelets from clumping together to form blood clots. Or you may get a blood thinner to keep existing clots from getting bigger. If you have carotid artery disease, you may also need a procedure to open your blocked carotid artery Acute treatments for hemorrhagic stroke focus on stopping the bleeding. The first step is to find the cause of bleeding in the brain. The next step is to control it: If high blood pressure is the cause of bleeding, you may be given blood pressure medicines. If an aneurysm if the cause, you may need aneurysm clipping or coil embolization. These are surgeries to prevent further leaking of blood from the aneurysm. It also can help prevent the aneurysm from bursting again. If an arteriovenous malformation (AVM) is the cause of a stroke, you may need an AVM repair.', '{0.11499924212694168,0.42429688572883606,0.160134956240654,-0.9353966116905212,0.19467368721961975,0.08338803797960281,0.3430185616016388,-0.31002864241600037,-0.4060145914554596,-0.597253680229187,0.2511146068572998,0.797235906124115,-0.35077983140945435,-0.7560759782791138,-0.6682100892066956,-0.04216187819838524,0.10967850685119629,-0.10922184586524963,-0.03176023066043854,0.2899397611618042,-0.6320306658744812,-0.4597274363040924,-0.14031115174293518,0.07467687129974365,0.6733673214912415,0.16426785290241241,-0.5407180190086365,-0.5444871783256531,-0.15871597826480865,0.6768398880958557,-0.9849278330802917,-0.10374399274587631,-0.4302208125591278,0.3253316879272461,-0.33072805404663086,-0.3835805356502533,-0.44889968633651733,0.9827340841293335,0.27117013931274414,-0.04440845549106598,-0.21426764130592346,0.282562792301178,-0.33257585763931274,-0.03721446543931961,0.030332051217556,-0.5892160534858704,-0.6535636782646179,0.0615785941481590